e sésamo. @BISCOTTI AVENA E CIOCCOLATO INGREDIENTI: Farina integrale di canna*, extra vergine doliva*, latte di soia*, cioccolato 9%* (zucchero di canna, pasta di cacao, burro di cacao, estratto di vaniglia), fibra d\'avena 0,73%*, aromi naturali*, agente lievitante: bicarbonato di sodio. (*Proveniente da agricoltura ecologica). Conservare in un luogo fresco e asciutto, proteggere dalla luce solare. Contiene glutine e scia e può contenere tracce di mandorle e sesamo. @ HAVRE OCHCHOKLADKAKA choklad 9% (rôrsocker, kakaomassa, kakaosmôr, vaniljextrakt) havrefiber jâsning: natriumbikarbonat. Fôrvaras torrt och svalt. Utsâtt inte fôr direkt solljus. (*Ekologisk odlad) Allergener: Innehàller gluten. Kan innehàlla spàr av mandel och sesam, Nâringsdeklaration per 100g: Energivârde kj2190 - Kcal 524, Fett 28,7g: varav mâttad fett 6,86g, enkelomâttat 19,54g, fleromâttat 2,29g, kolesterol Omg, Kolhydrater 60,3g: varav Socker Og, Laktos Detekteras inte, Fruktos &lt; 0,03g, Glykos &lt; 0,05g, Sackaros 38,2g, Fiber 0,8g, Protein 6,2g, Salt 0,09g. , * 0%40 : , * , ,l.sus', '', '28.7', '6.86', '60.3', '38.2', '0.8', '6.2', '0.09', '0.0354330708661417', '', '0');

