VALUES ('8437010011160', 'Zumo De Manzana Y Kiwi 750ML - Ekolo', 'Jus pommes et kiwi issu de l’agriculture biologique. Nous n\'aboutons rien d\'autre, rien que le jus du meilleur fruit frais. Chez Ékolo, nous sommes fiers non seulement d\'encourager des habitudes alimentaires équilibrées, qui favorisent la consommation de fruits, mais aussi la protection et la conservation de l\'environnement.  Les Jus de Fruits Ékolo sont élaborés suivant des méthodes traditionnelles à partir de fruits frais, cueillis à leur point de maturation dans des vergers menés en agriculture biologique puis sélectionnés à la main. L\'ensemble du processus garantit la saveur et l’arôme extraordinaires qui différencient nos produits.', '', '0.1', '0.1', '11.4', '10.6', '', '0.5', '0.01', '0.00393700787401575', '', '1');

